        <stop offset="0.295833" stop-color="#F8710F"/>
        <stop offset="1" stop-color="#5B5149" stop-opacity="0"/>
        </linearGradient>
        </defs>
        </svg>

   <div className="container my-5" >
       <h1 className="my-5 text-center">Become a certified photographer</h1>
       
   </div>
   </div>
  );
